// PHI Detection with Hardcoded Patient Data Structure
const inputData = $json.body;

// Hardcode PHI fields based on patient intake webhook structure
const phiClassification = {
  firstName: 'personal_identifier',
  lastName: 'personal_identifier',
  phoneNumber: 'contact_info',
  email: 'contact_info',
  age: 'demographic',
  gender: 'demographic',
  chiefComplaint: 'medical_info',
  symptoms: 'medical_info',
  medicalHistory: 'medical_info'
};

// Simple encryption for PHI fields
function encryptPHI(data, key = 'healthcare-phi-key') {
  let hash = 0;
  const str = data.toString() + key;
  for (let i = 0; i < str.length; i++) {
    const char = str.charCodeAt(i);
    hash = ((hash << 5) - hash) + char;
    hash = hash & hash;
  }
  return `ENC_${Math.abs(hash).toString(36).toUpperCase()}`;
}

// Generate patient ID
function generatePatientId() {
  const timestamp = Date.now().toString(36);
  const random = Math.random().toString(36).substr(2, 5);
  return `PAT_${timestamp}_${random}`.toUpperCase();
}

// Process the patient data
const patientId = generatePatientId();
const processedData = {};
const phiFields = [];
const encryptedFields = {};

// Process each field from the webhook
for (const [field, value] of Object.entries(inputData)) {
  if (phiClassification[field]) {
    phiFields.push(field);

    // Encrypt sensitive personal identifiers
    if (['firstName', 'lastName', 'phoneNumber', 'email'].includes(field)) {
      processedData[field] = encryptPHI(value);
      encryptedFields[field] = value; // Store original for lookup
    } else {
      processedData[field] = value; // Keep medical info unencrypted for analysis
    }
  } else {
    processedData[field] = value;
  }
}

// Create structured output
const output = {
  patientId: patientId,
  timestamp: new Date().toISOString(),
  originalData: processedData,
  phiFields: phiFields,
  phiClassification: phiClassification,
  riskLevel: 'medium', // Based on chest pain complaint
  urgencyScore: inputData.chiefComplaint?.toLowerCase().includes('chest pain') ? 8 : 5,
  patientEmail: inputData.email, // Keep for notifications
  encryptedLookup: encryptedFields,
  demographics: {
    age: inputData.age,
    gender: inputData.gender
  },
  clinicalData: {
    chiefComplaint: inputData.chiefComplaint,
    symptoms: inputData.symptoms,
    medicalHistory: inputData.medicalHistory
  }
};

return [output];

// Specialist Assignment Algorithm
// Get data from previous nodes using correct references
const specialists = $json; // Current node input (from PostgreSQL)
const llmAnalysis = $('Basic LLM Chain').first().json; // Your LLM node
const patientData = $('Patient Intake Webhook1').first().json; // Your webhook node  
const encryptedData = $('Code').first().json; // Your PHI processing node

// Parse the LLM response (it's in text format with JSON inside)
let analysis;
try {
  const cleanJson = llmAnalysis.text.replace(/```json\n?/g, '').replace(/```/g, '').trim();
  analysis = JSON.parse(cleanJson);
} catch (error) {
  analysis = {
    urgencyLevel: 8,
    disposition: 'admit for observation',
    error: 'Failed to parse LLM response'
  };
}

// Select first available specialist (highest availability first)
let assignedSpecialist = specialists[0] || {
  id: 'dr-davis',
  name: 'Dr. Robert Davis',
  specialty: 'Internal Medicine',
  slack_id: 'U567890',
  email: 'dr.davis@hospital.com',
  availability: 'high'
};

const caseId = `CASE-${Date.now()}`;

return [{
  ...patientData.body, // Patient intake data
  ...encryptedData, // PHI processed data
  aiAnalysis: analysis,
  assignedSpecialist: assignedSpecialist,
  availableSpecialists: specialists,
  assignmentTimestamp: new Date().toISOString(),
  caseId: caseId,
  status: 'pending_specialist_response',
  currentSpecialistIndex: 0
}];

