// Process Slack interaction payload
  const payload = $json.body;

  // Extract interaction data
  const action = payload.actions[0];
  const user = payload.user;
  const actionValue = action.value; // This is "test-case-123"
  const actionId = action.action_id; // This is "accept_case"

  // Determine the action taken based on action_id or value content
  let actionTaken = '';
  let nextStep = '';

  if (actionId === 'accept_case' || actionValue.includes('accept')) {
    actionTaken = 'case_accepted';
    nextStep = 'notify_team_assignment';
  } else if (actionId === 'reassign_case' || actionValue.includes('reassign')) {
    actionTaken = 'case_reassigned';
    nextStep = 'find_alternative_specialist';
  }

  return [{
    interactionType: payload.type,
    actionTaken: actionTaken,
    actionType: actionTaken, // Add this field for the IF branch
    caseId: actionValue,
    respondingUser: {
      id: user.id,
      name: user.name
    },
    channel: {
      id: payload.channel.id,
      name: payload.channel.name
    },
    timestamp: new Date().toISOString(),
    nextStep: nextStep,
    originalPayload: payload
  }];

// Handle case decline - find next specialist
const redisData = $('Get Case Data (Redis)1').first().json;
const caseData = JSON.parse(redisData.propertyName);
const currentIndex = caseData.currentSpecialistIndex || 0;
const nextIndex = currentIndex + 1;

// Note: availableSpecialists is an object, not array in your data structure
// We need to get all available specialists again
const availableSpecialists = [
  caseData.availableSpecialists, // Current specialist (Dr. Sarah Jones)
  // Add fallback specialists
  {
    id: 'dr-smith',
    name: 'Dr. James Smith',
    specialty: 'Cardiology',
    slack_id: 'U123456',
    email: 'dr.smith@hospital.com',
    availability: 'high'
  },
  {
    id: 'dr-davis',
    name: 'Dr. Robert Davis',
    specialty: 'Internal Medicine',
    slack_id: 'U567890',
    email: 'dr.davis@hospital.com',
    availability: 'high'
  }
];

if (nextIndex < availableSpecialists.length) {
  // Assign to next specialist
  const nextSpecialist = availableSpecialists[nextIndex];

  const updatedCase = {
    ...caseData,
    assignedSpecialist: nextSpecialist,
    currentSpecialistIndex: nextIndex,
    status: 'reassigned_to_next_specialist',
    reassignmentTimestamp: new Date().toISOString()
  };

  return [updatedCase];
} else {
  // No more specialists available
  const updatedCase = {
    ...caseData,
    status: 'no_specialists_available',
    requiresManualIntervention: true,
    escalationTimestamp: new Date().toISOString()
  };

  return [updatedCase];
}

