// Parse LLM output and extract specialist recommendation
const llmText = $json.text;

// Remove markdown formatting and parse JSON
const cleanJson = llmText.replace(/```json\n?/g, '').replace(/```/g, '').trim();
const medicalData = JSON.parse(cleanJson);

// Map to database specialty names (matching your database exactly)
let recommendedSpecialist = 'Internal Medicine'; // default

if (medicalData.differentialDiagnoses.some(d => d.toLowerCase().includes('coronary') || d.toLowerCase().includes('cardiac'))) {      
  recommendedSpecialist = 'Cardiology';
} else if (medicalData.differentialDiagnoses.some(d => d.toLowerCase().includes('pulmonary') ||
d.toLowerCase().includes('embolism'))) {
  recommendedSpecialist = 'Pulmonology';
} else if (medicalData.urgencyLevel >= 8) {
  recommendedSpecialist = 'Internal Medicine'; // Since you don't have Emergency Medicine
}

return [{
  ...medicalData,
  recommendedSpecialist: recommendedSpecialist,
  parsedFromLLM: true
}];

