// Combine all data sources for comprehensive email report
const llmReport = $json.text; // Current LLM node output
const patientHistory = $('Get Patient Medical History1').first().json;
const acceptanceData = $('Check If Accepted1').first().json;

// Extract specialist information from acceptance data
const specialistName = acceptanceData.respondingUser.name;
const specialistSlackId = acceptanceData.respondingUser.id;

// Map Slack ID to email
const specialistEmailMapping = {
  "U123456": "dr.smith@hospital.com",
  "U789012": "dr.jones@hospital.com",
  "U567890": "dr.davis@hospital.com"
};

const specialistEmail = specialistEmailMapping[specialistSlackId] || "unknown@hospital.com";

// Extract key information from LLM report
const rawMarkdown = llmReport.replace(/```markdown\n?/g, '').replace(/```/g, '').trim();

// Extract patient name and urgency
const patientNameMatch = rawMarkdown.match(/\*\*Name:\*\*\s*([^\n\r]*)/);
const patientName = patientNameMatch ? patientNameMatch[1].trim() : 'Unknown Patient';

const urgencyMatch = rawMarkdown.match(/\*\*Urgency Level:\*\*\s*(\d+)\/10/);
const urgencyLevel = urgencyMatch ? parseInt(urgencyMatch[1]) : 0;

const caseId = acceptanceData.caseId !== 'accept' ? acceptanceData.caseId : `CASE-${Date.now()}`;

// Convert markdown to HTML - FIXED STRING ESCAPING
function markdownToHtml(markdown) {
  return markdown
    .replace(/^# (.*$)/gm, '<h1 style="color: #dc3545; margin-top: 30px;">$1</h1>')
    .replace(/^## (.*$)/gm, '<h2 style="color: #0056b3; margin-top: 25px;">$1</h2>')
    .replace(/^### (.*$)/gm, '<h3 style="color: #666; margin-top: 20px;">$1</h3>')
    .replace(/\*\*(.*?)\*\*/g, '<strong>$1</strong>')
    .replace(/\*(.*?)\*/g, '<em>$1</em>')
    .replace(/^[\s]*- (.*$)/gm, '<li>$1</li>')
    .replace(/(<li.*<\/li>)/s, '<ul>$1</ul>')
    .replace(/\n\n/g, '<br><br>')
    .replace(/\n/g, '<br>')
    .replace(/---/g, '<hr>');
}

// Create email subject
const emailSubject = `ACCEPTED CASE (${urgencyLevel}/10) - ${patientName} | Specialist: ${specialistName} | Case: ${caseId}`;        

