        .accepted { background: #d4edda; color: #155724; padding: 15px; margin: 15px 0; text-align: center; font-weight: bold; }     
        ul { padding-left: 20px; }
        li { margin: 8px 0; }
        h1 { color: #dc3545; }
        h2 { color: #0056b3; }
    </style>
</head>
<body>
    <div class="header">
        <h1>MEDICAL CASE CONFIRMATION</h1>
        <p>Case Accepted & Complete Medical Assessment</p>
